import React from "react";
import { Box } from '@material-ui/core';

function EmailIcon() {
    return (
        <Box>
            <Box 
            component='img'
            src='/vectors/email.png'
            alt='email_logo'
            />
            <p>Messaging</p>
        </Box>

    )
}

export default EmailIcon;
